@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'hotelariaFRONT_END';
}
<img class="ui fluid image" src="/src/app/inicio/login/img/vista_escrita.png">
<div class="ui container">
    <div class="ui secondary pointing menu">
        <a routerLink="/inicio" routerLinkActive="active" class="active item">Meu Perfil</a>
        <a routerLink="/home" routerLinkActive="active" class="item">Home</a>
        <a routerLink="/reservas" routerLinkActive="active" class="item">Minhas Reservas</a>
    </div>
</div>
<br>
<div class="ui container">
    <div class="ui segment">
        <router-outlet></router-outlet>
    </div>    
</div>
